criteria.inclusion_criteria:
1. Male or Female;
2. Between 18 and 40 years of age, inclusive;
3. No chronic illness (e.g. hematologic disorders, renal disease, hepatitis, Diabetes Mellitus);
4. General health status acceptable for participation in the study;
5. Maximum weight no more than 100 Kg.

criteria.exclusion_criteria:
1. Violation of any inclusion criteria;
2. Failure to perform screening or baseline examinations;
3. Participation in another clinical trial within 30 days before the screening period of this study;
4. Likelihood to be unable to complete the study;
5. History or clinical evidence of drug or ethanol abuse;
6. History or clinical evidence of acute or chronic illness;
7. Significant abnormality of blood chemistry or hematologic parameters; 
8. Use of corticosteroids during the previous 14 days before screening.
Pregnant women and women with childbearing potential who are not using adequate methods to avoid pregnancy, cannot participate in the study
